    __webpack_exports__["default"] = "<div class=\"row\">\r\n    <div class=\"col\">\r\n        <h3>Readme</h3>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        <h5>Browser compatibility</h5>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row justify-content-center\">\r\n    <div class=\"col\">\r\n        <p> So far I have run the application successfully with <strong>Chrome</strong>,\r\n            <strong>Firefox</strong>,\r\n            <strong>Opera</strong>, <strong>Edge</strong> and <strong>Safari (iOS)</strong> browsers. I have also used the application successfully on a\r\n            mobile phone running Android with Chrome.\r\n        </p>\r\n        <p>\r\n            The application will function on <strong>Internet Explorer 11</strong> on Windows but has display issues where\r\n            the text and images overlap on some screen sizes.\r\n        </p>\r\n\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        <h5>Known issues</h5>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row justify-content-center\">\r\n    <div class=\"col\">\r\n        <pre>\r\nthe clue editor misinterprets letter counts like (6, 2 words) as _ _ _ _ _ _ / _ _\r\n\r\nIn the solver pressing ESC should cancel any highlighting\r\n\r\nWhen failing to download a puzzle distinguish between \"not found\" and general errors.  For example: when trying\r\nto open future puzzles in the Independent they may not be there yet.  This is not an error, so show a more appropriate \r\nerror message.\r\n\r\nSometimes the app does not correctly distinguish between a password mismatch and a network error, both show same message.\r\n\r\nGoogle diary shows wrong error message. If the user is not loggin in \"Failed to get diary\" is shown instead of \"Please log-in and try again\".\r\n\r\n        </pre>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        <h5>Ideas for improvements</h5>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row justify-content-center\">\r\n    <div class=\"col\">\r\n        <pre>\r\n\r\nIn the Solver screen make the clue editor moveable so that it does not obscure the grid.\r\n\r\nAdd a \"remember me\" cookie\r\n\r\nAdd a help tip somewhere to say that puzzles are automatically saved.  Also mention that saved puzzles are lost\r\nif you delete your browser history.\r\n\r\nAdd a backup feature so users can save/restore from a backup (if they want to delete their history)\r\n\r\nSort out return, tab, esc etc in editor so that it is easy to add solution and comments without using the mouse\r\n\r\nAdd a carte blanch tool\r\n\r\nAdd \"insert image from URL\" to clue and preamble editors\r\n\r\nInvestigate using REST API instead of XML-RPC - investigate adding OpenAuth to fifteensquared\r\n\r\nCreate favicon for the app - get Jessica to do this?\r\n\r\nLog usage statistics somewhere\r\n\r\nAdd a feedback facility somewhere. This could be permanent or just for the remainder of the development.\r\nPerhaps just a link to an email address?  Perhaps a page in the app where users can see the feedback\r\nfrom other users too.\r\n\r\nSend client-side errors to drurys.org for analysis (opt-in)\r\n        </pre>\r\n    </div>\r\n</div>";
